import React, { Component } from "react";
import "./App.css";
import punisher from "./Components/punisher.png";
// import cowboys from "./Components/cowboys.png";
import PlayerList from "./Components/PlayerList";

class App extends Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div className="App">
        <img src={punisher} />
        {/* <img src={cowboys} /> */}

        <h1>Waiver Wire Wizard</h1>
        <PlayerList />
      </div>
    );
  }
}

export default App;
